﻿
🔷施術解説🔷﻿
トゥインクルトゥイムで「目をより大きく、魅力的に」しました👍﻿
今回のトゥインクルトゥイムは【目頭矯正(MD式目頭切開 Long Ver.)+ツリ目矯正(MD式目尻切開+MD式下眼瞼下制結膜切開+MD式目の下の切らないたるみ取り)】を行っております。﻿
﻿
島田の目頭切開は二重の内側を広くできます‼️オリジナルデザインは島田の経験が為せるワザ‼️もちろんツリ目もきっちり改善‼️﻿
﻿
﻿
🧚🏻‍♀️トゥインクルトゥイム(島田式オーダーメイドデカ目術)が選ばれる4つの理由✨﻿
1️⃣手術経験が豊富‼️﻿
島田は目の手術において通算6000例以上の豊富な経験があります。二重/眼瞼下垂/目頭切開/目尻切開/タレ目/脱脂/眉下リフトなど、全ての治療の引き出しがあるため、あなたに最適なトゥインクルトゥイムをご提案できます。﻿
2️⃣SBC技術指導医‼️﻿
島田は300名以上のドクターが在籍するSBCでも約10人しかいない、若手ドクターの教育も担当しているベテラン技術指導医です。﻿
3️⃣カウンセリングが丁寧‼️﻿
みなさん一人一人ご希望は異なりますので、全力であなたの「なりたい」を引き出します。﻿
4️⃣ダウンタイム最小‼️﻿
島田のトゥインクルトゥイムはダウンタイム最小です。豊富な経験をもとに、出血しやすい部位を的確に判断します。腫れを最小に抑えることで細かなデザイン調整を可能にします。﻿
﻿
﻿
🧚🏻‍♀️✨特に島田式ツリ目矯正(タレ目+目尻)は通算症例数SBC史上１位㊗️✨✨﻿
﻿
🔱SBC20年間の歴史で最もツリ目矯正を担当した島田のこだわり🔱﻿
1️⃣ダウンタイムは最小に❗️﻿
2️⃣後戻りも最小に❗️﻿
3️⃣それを実現することで細かいカーブ調整も可能に❗️﻿
4️⃣さらには涙袋もぷっくり❗️﻿
このこだわりをご好評いただき、2020年もSBCで行われるほとんどのタレ目手術、目尻切開術を担当し、SBC圧倒的ナンバーワン‼️﻿
